import './App.css';
import Piechart from './Piechart';
import BarChart from './BarChart';
import HeatMap from './HeatMap';
class App extends Component {
  constructor(props) {
  super(props);
  this.state = {
    mydatasets:[
      ['Dataset1','Hello everyone! I am mamun',1],
      ['Dataset1','Good morning',0],
      ['Dataset1','Hello everyone! I am',1],
      ['Dataset1','Good morning Everyoe',0],
      ['Dataset1','Good night',0],
      ['Dataset1','Hello everyone!',0],
      ['Dataset1','Good afternoon Everyoe',1],
      ['Dataset2','Hello everyone! I am mamun',1],
      ['Dataset2','Good morning Everyoe',0],  
      ['Dataset2','Hello everyone! I am',1],
      ['Dataset2','Good morning',1],
      ['Dataset2','Good night',1],
      ['Dataset2','Hello everyone!',0],
      ['Dataset2','Good afternoon Everyoe',0],
      ['Dataset3','Hello everyone! I am mamun',1],
      ['Dataset3','Good morning Everyoe',0],  
      ['Dataset3','Hello everyone! I am',1],
      ['Dataset3','Good morning',0],
      ['Dataset3','Good night',0],
      ['Dataset3','Hello everyone!',0],
      ['Dataset3','Good afternoon Everyoe',1]
      ]
  }
 this.clickhandle=this.clickhandle.bind(this); 
};
clickhandle(){
  var ar=[];
  for(var key in this.state.idata){
    var pp=<Piechart dataset={this.state.idata[key]}></Piechart>;
    ar.push(pp);
  }
this.setState({piechart:ar})  
    }
render() {
    return (
     <div className="App">
      <div>
      <HeatMap datasets={this.state.mydatasets} size={[200,200]} />
      </div>
    </div>
    );
  }
}
export default App;






